import React from "react";

const QuizName = ({ quiz }) => {
  const { name, logo, id, total } = quiz;
  return (
    <div className="border-2 bg-slate-400 rounded-xl">
      <img src={logo} alt="" />
          <div className="my-4 px-4 ">
              <div></div>
              <div></div>
        <h2>display quiz name. {name}</h2>
        <p>Total Que: {total}</p>
        <button className="bg-blue-500 px-3 py-1 rounded-lg">Start Quiz</button>
      </div>
    </div>
  );
};

export default QuizName;
